  \"2015-03-16T16:58:56.711240\",\n\t\"name\": \"special-education-prevalence-2008-2013\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains K-12 special education
  prevalence rates by district for school years 2008-09, 2009-10, 2010-11, 2011-12,
  2012-13 and 2013-14. Prevalence is included for each disability type as well as
  overall special education. The overall special education prevalence is calculated
  by dividing the number of students with disabilities in a district by the total
  number of students in the district. Prevalence for individual disability types is
  calculated by dividing the number of students with the specific disability in a
  district by the total number of students in the district. Note: The category of
  Other Disability includes disabilities of Hearing Impairment, Visual Impairment,
  Orthopedic Impairment, Deaf/Blindness, Multiple Disabilities, Traumatic Brain Injury,
  and Developmental Delay.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
